 * @FilePath: \bl-device-manage\src\services\basic.js
 */
import { get, put } from '../utils/request';

export const requestList = {
  /* 基础信息 */
  getFieldNameAndType: '/manage/basic/getFieldProps',
  saveDatabase : '/manage/basic/saveDatabases'
}

export async function gets(type) {
  return async function (data, options) {
    return await get(requestList[type], data, options);
  }
}
export async function posts(type) {
  return async function (data, options) {
    return await put(requestList[type], data, options);
  }
}
